import React from 'react';


export function Content(props){
    const row = {
        open: <div className='row'>,
        close: </div>
    }

    return (
        <div className={props.container}>
            {row.open}
                <div className='col bg-primary'>1 of 4</div>
                <div className='col bg-secondary'>2 of 4</div>
                <div className='col bg-danger'>3 of 4</div>
                <div className='col bg-info'>4 of 4</div>
            {row.close}
        </div>
    )
}
